import React from 'react';
import './App.css';

let image = './static/images/A.png'

function App() {
  console.log(image)

  return (
    <div className="App">
      <header className="App-header">
        <img src={'http://placehold.it/400x20&text=slide1'} alt="Test image" className="img-responsive"  />
      </header>
    </div>
  );
}

export default App;
